import React from "react";
import { useSelector } from "react-redux";

const ResultadoPokemon = () => {
    const {
        loadingPokemon,
        buscadorPokemon: { data },
    } = useSelector((state) => state);
    console.log("loadingPokemon", loadingPokemon);
    return (
        <div>
            <h3 className="text-black">Resultado: </h3>
            {loadingPokemon && <div className="text-warning">Buscando...</div>}
            <div className="text-success">
                <img src={data?.sprites.front_default} alt={data?.name} />
                <span>{data?.name}</span>
            </div>
            {loadingPokemon && <span className="text-danger">Error</span>}
        </div>
    );
};

export default ResultadoPokemon;
